import React from "react";

const FaceRecognition = () => {
  return (
    <div className="center">
      <img
        alt=""
        src={
          "https://s3.amazonaws.com/samples.clarifai.com/featured-models/face-three-men-sitting-in-van.jpg?v=thumb"
        }
      />
    </div>
  );
};

export default FaceRecognition;
